    html body main section.second .zenvia-solutions .content {
      display: none;
      flex-direction: column;
      align-items: center;
      padding: 2rem 1rem 1rem 1rem;
    }

    html body main section.second .zenvia-solutions .content .img {
      width: 14rem;
      margin: 0rem 0rem 1rem 0rem;
    }

    html body main section.second .zenvia-solutions .content .text-button {
      display: flex;
      flex-direction: column;
      align-items: center;
    }

    html body main section.second .zenvia-solutions .content .text-button .text {
      margin: 0rem 0rem 1rem 0rem;
      font-weight: 400;
      color: #FFFFFF;
    }

    html body main section.second .zenvia-solutions .content .text-button .text .text-bolder {
      font-weight: 800;
      color: #FFFFFF;
    }

    html body main section.second .zenvia-solutions .content.selected {
      display: flex;
    }

    html body main section.third {
      background-color: #F5F8FB;
    }

    html body main section.third .ebooks {
      display: flex;
      flex-direction: column;
      align-items: center;
    }

    html body main section.third .ebooks .ebook {
      display: flex;
      flex-direction: column;
      align-items: center;
      margin: 0rem 0rem 2rem 0rem;
    }

    html body main section.third .ebooks .ebook .img {
      width: 14rem;
      margin: 0rem 0rem 1rem 0rem;
    }

    html body main section.third .ebooks .ebook .text {
      display: flex;
      flex-direction: column;
    }

    html body main section.third .ebooks .ebook .text .title {
      margin: 0rem 0rem 0.5rem 0rem;
      font-weight: 800;
      color: #000000;
    }

    html body main section.third .ebooks .ebook .text .subtitle {
      margin: 0rem 0rem 1rem 0rem;
      font-weight: 400;
      color: #000000;
    }

    html body main section.third .ebooks .ebook .text .button {
      margin: 0 auto;
    }

    html body main section.third .ebooks .ebook:last-of-type {
      margin: 0rem 0rem 0rem 0rem;
    }

    html body main section.fourth .posts {
      width: 100%;
      display: flex;
      flex-direction: column;
    }

    html body main section.fourth .posts .post {
